import * as React from 'react';
import { View, Text } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { Button } from 'react-native-web';

function MealPlannerScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems:'center', justifyContent:'center' }}>
      <Text>Meal Nutritions</Text> 
      <Button
        title="Go to Breakfast"
        onPress={() => navigation.navigate('Breakfast')}
      />    
    </View>
  );
}
function BreakfastScreen({navigation}) {
  return (
    <View style={{ flex: 1, alignItems:'center', justifyContent:'center' }}>
      <Text>Category</Text>
      <Button
        title="Go to Bluebarry Pancake"
        onPress={() => navigation.navigate('Bluebarry Pancake')}
      /> 
    </View>
  );
}

function BluebarryPancakeScreen({navigation}) {
  return (
    <View style={{ flex: 1, alignItems:'center', justifyContent:'center' }}>
      <Text>Category</Text>
      <Button
        title="Go to Meal Schedule"
        onPress={() => navigation.navigate('Meal Schedule')}
      /> 
    </View>
  );
}

function MealScheduleScreen({navigation}) {
  return (
    <View style={{ flex: 1, alignItems:'center', justifyContent:'center' }}>
      <Text> May 2021 </Text>
      <Button
        title="Go to "
        onPress={() => navigation.navigate('Meal Schedule')}
      /> 
    </View>
  );
}

const Stack = createNativeStackNavigator();

function App() {
  return(
    <div className="App">
      <input type="text" placeholder="Search..."/>
    </div>
  )
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="MealPlanner">
        <Stack.Screen name="Meal Planner"
        component={MealPlannerScreen}
        options={{
          title: 'Meal Planner',
          headerTitleAlign: 'center' 
        }} />
        <Stack.Screen name="Breakfast" 
        component={BreakfastScreen}
        options={{
          title: 'Breakfast',
          headerTitleAlign: 'center'
        }}
         /> 
        <Stack.Screen name="Bluebarry Pancake" 
        component={BluebarryPancakeScreen}
        options={{
          title: 'Bluebarry Pancake',
          headerTitleAlign: 'center'
        }} />
        <Stack.Screen name="Meal Schedule" 
        component={MealScheduleScreen}
        options={{
          title: 'Meal Schedule',
          headerTitleAlign: 'center'
        }} />    
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
